# Generated by scripts/localization_gen.py


def _config_pretty_models(_, count):
    ot = 'о'
    if count == 1:
        et = 'ь'
        ot = 'а'
    elif count in [2, 3, 4]:
        et = 'и'
    else:
        et = 'ей'
    pretty = ['ноль', 'одна', 'две', 'три', 'четыре', 'пять', 'шесть']
    count = pretty[count] if count < 7 else count
    return 'Загружен{} {} модел{}'.format(ot, count, et)


